                position += 1;
                const price = $(`#mbc > div:nth-child(${index + 1}) > div > span.a-declarative > div > div:nth-child(1)`).text();
                const seller = $(`#mbc-sold-by-${position} > span.a-size-small.mbcMerchantName`).text();
